import React from 'react'

function ProjectList({ children }) {
    return (
        <div className="list-overflow-container">
            <ul className="list-group">{children}</ul>
        </div>
    )
}

function ProjectButton({ children }) {
    return <button className="list-group-item btn btn-warning">{children}</button> 
}

export default {
    ProjectList,
    ProjectButton
}
